### Description

In the newest gitub "IDE SDK=v3.3.0" the command "`WiFi.disconnect(true,true)`" does NOT remove the previous "`WiFi.begin(ssid,pw)`" SSID/Password and causes any new "`WiFi.begin(ssid_v2,password_v2)`" to ingore the new ssid_v2 and connect using the old ssid/pw.

Note that in the older "IDE SDK=v3.1.1" the line "`WiFi.disconnect(true,true)`" wasn't even required as if the initial `WiFi.begin(ssid,pw) `did not work you could just issue a new `WiFi.begin(ssid2,pw2)` and that would work fine, but apparently not in "IDE SDK=v3.3.0".


### Sketch

```cpp
// Note that in the newest gitub "IDE SDK=v3.3.0" the command "WiFi.disconnect(true,true)" does NOT remove the previous SSID/Password
// and causes any new "WiFi.begin(ssid_v2,password_v2)" to ingore the new ssid_v2 and connect using the old ssid.

// Note that in the older "IDE SDK=v3.1.1" the line "WiFi.disconnect(true,true)" wasn't even required as if the initial WiFi.begin(ssid,pw) did not work
// you could just issue a new WiFi.begin(ssid2,pw2) and that would work fine, but apparently not in "IDE SDK=v3.3.0".


#include <WiFi.h> // Note I do not want to use "<WiFiMulti.h>" as I want to choose 1 or other of the SSIDs

const char *ssid_v1     = "dummy_ssid";
const char *password_v1 = "dummy_password";

const char *ssid_v2     = "your-ssid";
const char *password_v2 = "your-password";

void setup() {
  Serial.begin(115200);
  delay(3000);
  Serial.printf("\nIDE SDK=v%s\n",ESP_ARDUINO_VERSION_STR);
  Serial.printf("Try Connecting to [%s]\n",ssid_v1);
  WiFi.begin(ssid_v1,password_v1);
  delay(5000);
  if (WiFi.status()==WL_CONNECTED)  Serial.printf("Connected OK to [%s]\n",ssid_v1);
  else {
    Serial.println("No Connection, so now doing a 'WiFi.disconnect(true,true)'"); 
    WiFi.disconnect(true,true); // NB. this command should remove the previos ssid & password, but it doesn't
    //                             -------------------------------------------------------------------------- 
    Serial.printf("\nNow try Connecting to [%s]\n",ssid_v2);
    WiFi.begin(ssid_v2,password_v2); // NB. this new ssid will be ignored and the previously entered ssid will be used
    //                                  ------------------------------------------------------------------------------
    while(WiFi.status()!=WL_CONNECTED) {Serial.write('.'); delay(500);} 
    Serial.printf("\nConnected OK, but actualy will have connected to [%s] NOT to the requested [%s]\n",ssid_v1,ssid_v2);
  }
  Serial.println("End of setup"); 
}

void loop() {}
```

